import Dot from "./dot";
import HorizontalLine from "./horizontal_line";

const RowWithDots = () => {
    return (
        // <div className="row_with_dots">
        //     <Dot/>
        //     <HorizontalLine/>
        //     <Dot/>
        //     <HorizontalLine/>
        //     <Dot/>
        //     <HorizontalLine/>
        //     <Dot/>
        // </div>
        <tr>
            <td><Dot /></td>
            <td><HorizontalLine/></td>
            <td><Dot /></td>
            <td><HorizontalLine/></td>
            <td><Dot /></td>
            <td><HorizontalLine/></td>
            <td><Dot /></td>
        </tr>
    )
}

export default RowWithDots;
